import React, {useState} from 'react';
import Logo from "../assets/logo.png"
import {AiOutlineClose, AiOutlineMenu} from 'react-icons/ai';

const Navbar = () => {

    const [nav, setNav]=useState(false);

    const handleNav = () => {
        setNav(!nav)
    };

  return (
    <div className='text-black flex  justify-between items-center h-24 max-w-[1240px] mx-auto px-4 '>

        <div className='hidden md:flex p-4'> <img   src={Logo} alt="Logo" style={{ width: "50px" }} /></div>

        <ul className=' hidden md:flex '>

            <li className='p-4'>Home</li>
            <li className='p-4'>About</li>
            <li className='p-4'>Team</li>
            <li className='p-4'>Shop</li>
        </ul>


        <div onClick={handleNav} className='block md:hidden'>
            {nav ?  <AiOutlineClose size={20}/> : <AiOutlineMenu size={20}/> }

        </div>

        <div className='p-4'> <img   src={Logo} alt="Logo" style={{ width: "50px" }} /></div>

            <ul          className={nav ? 'fixed left-0 top-0 h-full w-[60%] ease-in duration-400' : 'fixed left-[-100%] top-0 h-full w-[100%] ease-in-out duration-500'}>
            <div className='p-4'> <img   src={Logo} alt="Logo" style={{ width: "50px" }} /></div>
              <li className='p-4 border-b border-black'>Home</li>
              <li className='p-4 border-b border-black'>About</li>
              <li className='p-4 border-b border-black'>Team</li>
              <li className='p-4'>Shop</li>
            </ul>

        </div>





  )
}

export default Navbar
